def download(filename, url):
    filepath = os.path.join('images', filename)
    if os.path.exists(filepath):
        return "skip"
    try:
        req = urllib.request.Request(url, headers={
            'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36'
        })
        with urllib.request.urlopen(req, timeout=30) as response:
            with open(filepath, 'wb') as f:
                f.write(response.read())
        return "ok"
    except Exception as e:
        return f"error: {e}"

print(f"📷 Скачиваю {len(IMAGES)} фотографий...")
print()

ok = 0
skip = 0
fail = 0

for i, (filename, url) in enumerate(IMAGES, 1):
    result = download(filename, url)
    if result == "ok":
        print(f"✅ [{i}/{len(IMAGES)}] {filename}")
        ok += 1
    elif result == "skip":
        print(f"⏭️  [{i}/{len(IMAGES)}] {filename} (уже есть)")
        skip += 1
    else:
        print(f"❌ [{i}/{len(IMAGES)}] {filename} - {result}")
        fail += 1



if fail > 0:
    print()
    print("Некоторые фото не скачались.")
    print("   Возможно ссылки истекли — скачай свежий KML и попробуй снова.")
